import React, { useState } from 'react'
import GetRadon from './GetRadon';

function Selector() {

    const [isOpen, setOpen] = React.useState(false);

    const radonClick = () => {
        const target = document.getElementById('radon')
        const btn = document.getElementById('toggle')
        btn.onclick = function() {
            if (target.style.display !== 'none') {
                target.style.display = 'none';
            }
            else {
                target.style.display = 'block';
            }
        }
        setOpen(!isOpen);
    }

    const bc_maapClick = () => {
        setOpen(!isOpen);
    }
    
    const bc_mageeClick = () => {
        setOpen(!isOpen);
    }

    const mp_grimmClick = () => {
        setOpen(!isOpen);
    }

    const mpClick = () => {
        setOpen(!isOpen);
    }

    const radiometroClick = () => {
        setOpen(!isOpen);
    }

    return (
        <div>
            <button className='button' id='toggle' type="button" onClick={radonClick}>Radon</button>
            <button className='button' id='toggle' type="button" onClick={bc_maapClick}>BC-MAAP</button>
            <button className='button' id='toggle' type="button" onClick={bc_mageeClick}>BC-Magee</button>
            <button className='button' id='toggle' type="button" onClick={mp_grimmClick}>MP-GRIMM</button>
            <button className='button' id='toggle' type="button" onClick={mpClick}>Multi-parametro</button>
            <button className='button' id='toggle' type="button" onClick={radiometroClick}>Radiometro</button>
            
        </div>
    );
};

export default Selector;
